    "Use bookmarks to help you easily return to courseware pages. To bookmark a page, select Bookmark in the upper right corner of that page. To see a list of all your bookmarks, select Bookmarks in the upper left corner of any courseware page.": "\u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0439\u0442\u0435 \u0437\u0430\u043a\u043b\u0430\u0434\u043a\u0438 \u0449\u043e\u0431\u0438 \u0448\u0432\u0438\u0434\u043a\u043e \u043f\u043e\u0432\u0435\u0440\u0442\u0430\u0442\u0438\u0441\u044f \u0434\u043e \u0441\u0442\u043e\u0440\u0456\u043d\u043e\u043a \u043a\u0443\u0440\u0441\u0443. \u0429\u043e\u0431 \u0434\u043e\u0434\u0430\u0442\u0438 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0443 \u0443 \u0437\u0430\u043a\u043b\u0430\u0434\u043a\u0438, \u043d\u0430\u0442\u0438\u0441\u043d\u0456\u0442\u044c \u0414\u043e\u0434\u0430\u0442\u0438 \u0443 \u0437\u0430\u043a\u043b\u0430\u0434\u043a\u0438 \u0443 \u0432\u0435\u0440\u0445\u043d\u044c\u043e\u043c\u0443 \u043f\u0440\u0430\u0432\u043e\u043c\u0443 \u043a\u0443\u0442\u043a\u0443 \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e\u0457 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438. \u0429\u043e\u0431 \u043f\u043e\u0431\u0430\u0447\u0438\u0442\u0438 \u0441\u043f\u0438\u0441\u043e\u043a \u0432\u0441\u0456\u0445 \u0432\u0430\u0448\u0438\u0445 \u0437\u0430\u043a\u043b\u0430\u0434\u043e\u043a, \u043d\u0430\u0442\u0438\u0441\u043d\u0456\u0442\u044c \u0417\u0430\u043a\u043b\u0430\u0434\u043a\u0438 \u0443 \u0432\u0435\u0440\u0445\u043d\u044c\u043e\u043c\u0443 \u043b\u0456\u0432\u043e\u043c\u0443 \u043a\u0443\u0442\u043a\u0443 \u0431\u0443\u0434\u044c-\u044f\u043a\u043e\u0457 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438.", 
